import React from 'react';
import Container from '@material-ui/core/Container';

const PrintQuote = (props) => {
   console.log(props);
    return (
        <div className="printQuote">
            <Container maxWidth="sm"  style={{ backgroundColor: '#cfe8fc', height: 'auto' }} >
                <h1>{props.quotes.text}</h1>
                <p>{props.quotes.author}</p>
            </Container>
            <a href="https://twitter.com/intent/tweet?button_hashtag=RandomQuote&ref_src=twsrc%5Etfw" class="twitter-hashtag-button" data-show-count="false">Tweet #RandomQuote</a><script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>
        </div>
    )
}

export default PrintQuote;
